import React from "react";
import styled from "styled-components";

function ItemListContainer({ greeting }) {
    return (
      <div>
        <ListContainer>
        <p>{greeting}</p>
        </ListContainer>
      </div>
    );
  }
  
  export default ItemListContainer;

const greeting = styled.list`
p{
font-size: 25px;
}
`
